window.bookSummaryJSON = "<p>I hated her defiance....</p> <p>But it made me want her even more.</p> <p>Her brother was my friend...and my boss. She was off-limits. </p> <p>Kassie Fox. </p> <p>From the first moment she looked in my direction, I knew she would be mine. </p> <p>It's impossible to stay away. </p> <p>I'm breaking all the rules...and shattering the golden rule I live by: Never trust a woman. Ever. </p> <p>The more she pushes, the more I pull. We're the same. I know what she needs. And I'm about to prove that she can trust one man. Her man. Me.</p> <p>Will her defiance land her in my bed or out of my life for good?</p> <p><b>Dear listener, </b><b><i>Defy You</i></b><b> is a steamy and emotional brother's-best-friend forbidden romance and is the third book in the Rebel Ink series.</b></p>"; 
